import ADD_PERSON from '../action/types';


const initialState = {
  setname: "",
  seturl: ""
};

export default function todosReducer(state = initialState, action) {
  switch (action.type) {
    case 'ADD_TODO_SUCCESS':
      return {
        ...state,
        success: 'true'
      };
    case 'ADD_TODO_FAILURE':
      return {
        ...state,
        failed: 'false'
      };
    default:
      return state;
  }
 }
